import axios from 'axios'

export const createIssue = async (title, description, labels) => {
  const url = 'https://issue-tracker-spring-boot.herokuapp.com/issue'

  const issue = {
    title: 'issue 1',
    description: 'description 1',
    labels: []
  }
  return await axios.post(url, issue)
}
